from sympy import proper_divisors
def min_divs(n: int) -> int:
    if n <= 1: return -1
    dp = {0: 0}
    for d in proper_divisors(n):
        n_dp = dp.copy()
        for s, count in dp.items():
            n_sum = s + d
            if n_sum <= n:
                n_count = count + 1
                if n_sum not in n_dp or n_count < n_dp[n_sum]:
                    n_dp[n_sum] = n_count
        dp = n_dp
    return dp.get(n, -1)
print([a for n in range(1, 500) if (a := min_divs(n)) > 0]) # _Peter Luschny_, Jan 08 2026

